import React from "react";
import { Link } from 'react-router-dom';



const LandingPage = () => {
    return (
        <div >
            <div >
              
                <div>Bienvenido a Brainly</div>

               <div>
                    <Link to = '/home'>
                        <button>INGRESAR</button>
                    </Link>
                </div>

            </div>

        </div>
    );
}

export default LandingPage;
